selector_to_html = {"a[href=\"accessing-data/newspapers-and-gazettes-titles.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">15.4. </span>Accessing data about newspaper &amp; gazette titles<a class=\"headerlink\" href=\"#accessing-data-about-newspaper-gazette-titles\" title=\"Permalink to this heading\">#</a></h1><h2><a class=\"toc-backref\" href=\"#id2\" role=\"doc-backlink\">What\u2019s a title?</a><a class=\"headerlink\" href=\"#whats-a-title\" title=\"Permalink to this heading\">#</a></h2><p>\u2018Titles\u2019 in this context refers to the names and details of the publications whose articles are digitised in Trove\u2019s <em>Newspapers &amp; Gazette\u2019s</em> category. For example: <em>Canberra Times</em>, <em>Sydney Morning Herald</em>, or <em>Commonwealth of Australia Gazette</em>.</p>", "a[href=\"how-to/digitised/download-items-text-images.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">22.2. </span>HOW TO: Automate the download of digitised items as text, images, or PDFs<a class=\"headerlink\" href=\"#how-to-automate-the-download-of-digitised-items-as-text-images-or-pdfs\" title=\"Permalink to this heading\">#</a></h1><p>You can download text, images, and PDFs from individual digitised items <span class=\"xref myst\">using the Trove web interface</span>. But only the text of periodical articles is available for machine access through the Trove API. This makes it difficult to assemble datasets, or build processing pipelines involving digitised resources. This page documents a series of work arounds that enable you to automate the download of digitised items as text, images, or PDFs.</p>", "a[href=\"how-to/newspapers/querypic.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">19.1. </span>Visualising newspaper searches with QueryPic<a class=\"headerlink\" href=\"#visualising-newspaper-searches-with-querypic\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"how-to/newspapers/get-newspaper-issue-article-pdfs.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">19.2. </span>HOW TO: Get a newspaper issue or article as a PDF<a class=\"headerlink\" href=\"#how-to-get-a-newspaper-issue-or-article-as-a-pdf\" title=\"Permalink to this heading\">#</a></h1><p>You can download PDFs of newspaper and gazette articles, pages, and issues from Trove\u2019s web interface \u2013 it\u2019s just a matter of clicking a button. But downloading PDFs using computational methods is not so straightforward. When you click on the buttons in the web interface, you don\u2019t download the PDF from a fixed url. There\u2019s a bit of Javascript code behind the button that asks for for the PDF to be compiled, then alerts the user when it\u2019s ready. To automate the download process, you need to reproduce these steps in your code. This how-to provides an example of how this can be done using Python.</p>", "a[href=\"what-is-trove/trove-web-interface.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">7. </span>The Trove web interface<a class=\"headerlink\" href=\"#the-trove-web-interface\" title=\"Permalink to this heading\">#</a></h1><p>For most users, Trove is defined by its web interface \u2013 by the screens, buttons, boxes, links, and lists you interact with as you navigate around the site. This guide focuses on getting and using the data that sits behind the web interface, but, in some cases, access to data is constrained by the design and functioning of the site. It\u2019s therefore useful to think about the different components of the web interface and how they fit together.</p>", "a[href=\"what-is-trove/metadata-and-digital-objects.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">4. </span>Metadata and digital objects<a class=\"headerlink\" href=\"#metadata-and-digital-objects\" title=\"Permalink to this heading\">#</a></h1><h2><span class=\"section-number\">4.1. </span>Working notes<a class=\"headerlink\" href=\"#working-notes\" title=\"Permalink to this heading\">#</a></h2><p>Trove is a mix</p><p>Often we want the digital objects \u2013 text and images, allow more options</p>", "a[href=\"understanding-search/understanding-search.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">9. </span>Understanding search<a class=\"headerlink\" href=\"#understanding-search\" title=\"Permalink to this heading\">#</a></h1><p>Searching collections of digital resources is a research method. Need to understand options and plan approach, recognising the limits of any search interface.</p><p>Search enables you to find items of relevance to your research and assemble a dataset for further analysis. Creating search queries is an iterative process \u2013 refining parameters, checking results etc.</p>", "a[href=\"collections-and-contexts/newspaper-corpus.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">11. </span>Understanding the newspaper corpus<a class=\"headerlink\" href=\"#understanding-the-newspaper-corpus\" title=\"Permalink to this heading\">#</a></h1><p>This section will examine the way in which the Trove newspaper corpus has been constructed, and how its contents have changed over time.</p>", "a[href=\"accessing-data/using-web-interface.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">14.1. </span>Downloading data from the Trove web interface<a class=\"headerlink\" href=\"#downloading-data-from-the-trove-web-interface\" title=\"Permalink to this heading\">#</a></h1><p>See <a class=\"reference internal\" href=\"what-is-trove/trove-web-interface.html\"><span class=\"doc std std-doc\">The Trove web interface</span></a> for a overview of the different components that make up the web interface. In particular, it\u2019s important to understand the difference between the main search interface and the digitised item viewers.</p>", "a[href=\"accessing-data/digitised-resources.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">16. </span>Digitised resources<a class=\"headerlink\" href=\"#digitised-resources\" title=\"Permalink to this heading\">#</a></h1><p>This section describes how to access data from resources (other than newspapers and gazettes) that have been digitised by the NLA and partners and delivered through Trove. This includes things likes books, periodicals, photographs, maps, oral histories, and manuscript collections.</p><p>These resources are spread across multiple categories and mixed with records aggregated from other collections. This makes finding NLA digitised items quite challenging. The one exception to this is periodical articles, which have their own <em>Magazines &amp; Newsletters</em> category.</p>", "a[href=\"how-to/newspapers/newspapers-and-gazettes.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">19. </span>Newspaper and gazettes how to\u2026<a class=\"headerlink\" href=\"#newspaper-and-gazettes-how-to\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"accessing-data/trove-api-intro.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">14.2. </span>Trove API introduction<a class=\"headerlink\" href=\"#trove-api-introduction\" title=\"Permalink to this heading\">#</a></h1><p>Use the Trove Application Programming Interface (API) to get direct access to Trove data. Just make a request  and get back data in a predictable, structured format that computers can understand.</p>", "a[href=\"collections-and-contexts/newspapers-copyright.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">11.4. </span>Newspapers and copyright<a class=\"headerlink\" href=\"#newspapers-and-copyright\" title=\"Permalink to this heading\">#</a></h1><p>This section will examine both the impact of copyright restrictions on the construction of the Trove newspaper corpus, and the implications of copyright for researchers making use of digitised newspapers.</p><p>See <a class=\"reference external\" href=\"https://glam-workbench.net/trove-newspapers/Beyond_the_copyright_cliff_of_death/\">Beyond the copyright cliff of death</a> and <a class=\"reference external\" href=\"https://glam-workbench.net/trove-newspapers/csv-newspapers-post-54/\">Trove newspapers with articles published after 1954</a></p>", "a[href=\"accessing-data/newspapers-and-gazettes.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">15. </span>Newspapers and gazettes<a class=\"headerlink\" href=\"#newspapers-and-gazettes\" title=\"Permalink to this heading\">#</a></h1><p><mark>==This might link to a fuller discussion in the contexts section?==</mark></p><p>Before you start requesting data from Trove\u2019s digitised newspapers, it\u2019s worth thinking a bit about the way newspapers are represented in Trove and the relationships between <strong>articles</strong>, <strong>pages</strong>, <strong>issues</strong>, and <strong>titles</strong>. You might think that newspapers are organised in a simple hierarchical structure with titles at the top, and articles at the bottom, but it\u2019s not quite that straighforward. Articles are linked to both pages and titles. Titles have their own API endpoint that can lead you to issues, though following an issue url will actually take you to a page. Pages have identifiers, and you can browse their contents in the Trove web interface, but they don\u2019t exist as separate entities in the API. These sorts of oddities mean that sometimes there\u2019s no direct route to the information that you want, but by thinking about what is connected to what, you can find alternative paths. For example, while there\u2019s no direct link between issues and articles, if you get the publication date and title from an issue, you can then search for articles published in that issue by using the <code class=\"docutils literal notranslate\"><span class=\"pre\">date</span></code> index and <code class=\"docutils literal notranslate\"><span class=\"pre\">title</span></code> facet.</p>", "a[href=\"accessing-data/data-access-options.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">14. </span>Data access options<a class=\"headerlink\" href=\"#data-access-options\" title=\"Permalink to this heading\">#</a></h1><p>There are many different <span class=\"xref myst\">types of data</span> available from Trove and many different ways of accessing it. You can manually download some data, such as images, from Trove\u2019s web interface. If you\u2019re creating small, selective datasets, these manual methods might be all you need.</p><p>But what if you want to save <em>all</em> the results from a search, automate downloading of images and text, or create a pipeline to feed Trove data into a specific tool for analysis? In these sorts of cases, you need access methods that are reusable and extensible \u2013 methods that can be invoked using code and that deliver data in a <a class=\"reference internal\" href=\"glossary.html#term-Machine-readable\"><span class=\"xref std std-term\">machine readable</span></a> format that computers can manipulate.</p>", "a[href=\"how-to/digitised/digitised-resources.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">22. </span>Digitised resources<a class=\"headerlink\" href=\"#digitised-resources\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"types-of-data/types-of-data.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">8. </span>Types of data<a class=\"headerlink\" href=\"#types-of-data\" title=\"Permalink to this heading\">#</a></h1><p>Types of data:</p>", "a[href=\"collections-and-contexts/newspapers-non-english.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">11.3. </span>Non-English language newspapers<a class=\"headerlink\" href=\"#non-english-language-newspapers\" title=\"Permalink to this heading\">#</a></h1><p>See <a class=\"reference external\" href=\"https://glam-workbench.net/trove-newspapers/find-non-english-newspapers/\">Finding non-English newspapers in Trove</a> in the GLAM Workbench and the <a class=\"reference external\" href=\"https://glam-workbench.net/trove-newspapers/list-non-english-newspapers/\">list of non-English language newspapers</a>.</p><p>Discuss implications for search and OCR correction.</p>", "a[href=\"how-to/api/harvest-complete-results.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.1. </span>HOW TO: Harvest a complete set of search results using the Trove API<a class=\"headerlink\" href=\"#how-to-harvest-a-complete-set-of-search-results-using-the-trove-api\" title=\"Permalink to this heading\">#</a></h1><p>See <a class=\"reference internal\" href=\"accessing-data/trove-api-intro.html\"><span class=\"doc\">Trove API introduction</span></a> for general information about using the Trove API.</p>", "a[href=\"collections-and-contexts/digitised-collections.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12. </span>Digitised collections<a class=\"headerlink\" href=\"#digitised-collections\" title=\"Permalink to this heading\">#</a></h1><p>This section will explore digitised collections, other than newspapers.</p>", "a[href=\"what-is-trove/links-and-identifiers.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">6. </span>Links and identifiers<a class=\"headerlink\" href=\"#links-and-identifiers\" title=\"Permalink to this heading\">#</a></h1><p>As you navigate around Trove you\u2019ll find a range of url patterns pointing to different types of resources. Some examples are:</p>", "a[href=\"references.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">References<a class=\"headerlink\" href=\"#references\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"what-is-trove/categories-and-zones.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2. </span>Categories and zones<a class=\"headerlink\" href=\"#categories-and-zones\" title=\"Permalink to this heading\">#</a></h1><p>Trove\u2019s resources are divided into <strong>categories</strong>. Understanding the nature and content of these categories will help you construct effective searches and access useful data.</p><p>There are nine categories in Trove:</p>", "a[href=\"accessing-data/trove-lists.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">17. </span>Trove lists<a class=\"headerlink\" href=\"#trove-lists\" title=\"Permalink to this heading\">#</a></h1><h2><span class=\"section-number\">17.1. </span>Metadata<a class=\"headerlink\" href=\"#metadata\" title=\"Permalink to this heading\">#</a></h2><h3>Getting list metadata using the web interface<a class=\"headerlink\" href=\"#getting-list-metadata-using-the-web-interface\" title=\"Permalink to this heading\">#</a></h3>", "a[href=\"how-to/digitised/get-collection-items.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">22.1. </span>HOW TO: Get a list of items in a digitised collection<a class=\"headerlink\" href=\"#how-to-get-a-list-of-items-in-a-digitised-collection\" title=\"Permalink to this heading\">#</a></h1><p>The NLA\u2019s digitised resources are often presented as \u2018collections\u2019. A collection could be the volumes in a multi-volume work, the issues of a periodical, a map series, an album of photographs, or a manuscript collection. In the web interface, collections will have a \u2018Browse this collection\u2019 link or button that displays a list of the contents, but getting machine-readable data is not so straightforward. You can use the <code class=\"docutils literal notranslate\"><span class=\"pre\">magazine/title</span></code> API endpoint to get a list of issues from a periodical, but there\u2019s no way to get the contents of other types of collections from the Trove API.</p><p><mark>==Insert screencap==</mark></p>", "a[href=\"what-is-trove/trove-is.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1. </span>Trove is\u2026<a class=\"headerlink\" href=\"#trove-is\" title=\"Permalink to this heading\">#</a></h1><p><strong>Trove is not one thing</strong>. On the <a class=\"reference external\" href=\"https://trove.nla.gov.au/about/what-trove/technical-ecosystem\">technical front</a>, Trove is a combination of many interconnected systems, data sources, and interfaces, each with its own individual history. But Trove is also an idea, an ambition, an attempt to provide Australians with facilitated access to research and heritage collections from across the country. That idea, expressed through policy documents, strategic plans, resource allocations, and collaborative agreements has also evolved over the past 15 years. At the same time, Trove has been enriched by its community of users, both by submitting annotations and corrections through the web interface, and by sharing their own research, methods, tools, and discoveries across the web. Trove now is the product of these entwined histories \u2013 technology, policy, and community.</p>", "a[href=\"accessing-data/newspapers-and-gazettes-articles.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">15.1. </span>Accessing data about newspaper and gazette articles<a class=\"headerlink\" href=\"#accessing-data-about-newspaper-and-gazette-articles\" title=\"Permalink to this heading\">#</a></h1><p><img alt=\"Screenshot of Trove web interface displaying basic article metadata\" src=\"_images/trove-article-metadata.png\"/></p>", "a[href=\"what-is-trove/categories-and-zones.html#categories\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3. </span>Categories<a class=\"headerlink\" href=\"#categories\" title=\"Permalink to this heading\">#</a></h1><p>Books &amp; libraries is the default, then use type.</p>", "a[href=\"collections-and-contexts/aggregated-collections.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13. </span>Aggregated collections<a class=\"headerlink\" href=\"#aggregated-collections\" title=\"Permalink to this heading\">#</a></h1><p>This sections will examine the collections aggregated into Trove.</p>", "a[href=\"collections-and-contexts/collections-and-contexts.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">10. </span>Collections and contexts<a class=\"headerlink\" href=\"#collections-and-contexts\" title=\"Permalink to this heading\">#</a></h1><p>This section will expand on some of the issues and questions raised in <a class=\"reference internal\" href=\"what-is-trove/trove-is.html\"><span class=\"doc std std-doc\">What is Trove?</span></a> section, looking in depth at what we can know about the contents of the different Trove cattgories and what this means for researchers.</p>", "a[href=\"demo.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Jupyter Book demo page<a class=\"headerlink\" href=\"#jupyter-book-demo-page\" title=\"Permalink to this heading\">#</a></h1><p>Trove is not one thing. <span id=\"id1\">[<a class=\"reference internal\" href=\"references.html#id18\" title=\"Tim Sherratt. Hacking Heritage: Understanding the Limits of Online Access. In H Lewi, W Smith, D von Lehn, and S Cooke, editors, The Routledge International Handbook of New Digital Practices in Galleries, Libraries, Archives, Museums and Heritage Sites, pages 116\u2013130. Routledge, London, 2019. doi:10.5281/zenodo.5035855.\">Sherratt, 2019</a>]</span></p>", "a[href=\"accessing-data/newspapers-and-gazettes-pages.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">15.2. </span>Accessing data about newspaper &amp; gazette pages<a class=\"headerlink\" href=\"#accessing-data-about-newspaper-gazette-pages\" title=\"Permalink to this heading\">#</a></h1><p><img alt=\"Screenshot of the masthead at the top of a newspaper page\" src=\"_images/16635065-level4-cropped.jpg\"/></p>", "a[href=\"how-to/web-interface/use-zotero.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">20.4. </span>Using Zotero to save items<a class=\"headerlink\" href=\"#using-zotero-to-save-items\" title=\"Permalink to this heading\">#</a></h1><p><mark>==If I rewrite the translator to use the API I can expand this section to include other content types==</mark></p>", "a[href=\"how-to/web-interface/use-lists.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">20.3. </span>Using Trove lists to create a dataset<a class=\"headerlink\" href=\"#using-trove-lists-to-create-a-dataset\" title=\"Permalink to this heading\">#</a></h1><p>Another option for creating collections of manually selected newspaper article metadata is Trove\u2019s built-in Lists function.</p><p><mark>==Note about adding mutliple items to Lists. Hacking the url to get more==</mark></p>", "a[href=\"collections-and-contexts/newspapers-ocr.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">11.5. </span>OCR quality and correction<a class=\"headerlink\" href=\"#ocr-quality-and-correction\" title=\"Permalink to this heading\">#</a></h1><p>This section will examine how the quality of OCR varies across the corpus and the significance of this for research uses. It will also look at patterns in OCR correction \u2013 what gets corrected and why.</p><p>See: <a class=\"reference external\" href=\"https://glam-workbench.net/trove-newspapers/Analysing_OCR_corrections/\">Analyse rates of OCR correction</a></p>", "a[href=\"accessing-data/newspapers-and-gazettes-issues.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">15.3. </span>Accessing data about newspaper &amp; gazette issues<a class=\"headerlink\" href=\"#accessing-data-about-newspaper-gazette-issues\" title=\"Permalink to this heading\">#</a></h1><h2><a class=\"toc-backref\" href=\"#id4\" role=\"doc-backlink\">What are issues?</a><a class=\"headerlink\" href=\"#what-are-issues\" title=\"Permalink to this heading\">#</a></h2><p>An issue is a single edition of a newspaper published on a particular date. Some newspapers published multiple editions each day, however, Trove holds only one edition per day for each newspaper. This means that issues in Trove can be identified and analysed by date.</p>", "a[href=\"collections-and-contexts/newspapers-missing-pages.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">11.2. </span>Missing newspaper pages and issues<a class=\"headerlink\" href=\"#missing-newspaper-pages-and-issues\" title=\"Permalink to this heading\">#</a></h1><p>This section will attempt some analysis of missing pages and issues in Trove\u2019s newspapers. As of 11 August 2023, I\u2019m running a very long harvest of essentially every article in Trove to try and get an idea of what\u2019s missing. This will never be precise, but it should at least provide a baseline and point to specific titles and periods that seem to be more affected.</p><p>Here\u2019s a <a class=\"reference external\" href=\"https://hcommons.social/@wragge/110845292959103039\">quick example using the Canberra Times</a>.</p>", "a[href=\"collections-and-contexts/newspapers-change-over-time.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">11.1. </span>How does the contents of the newspaper corpus change over time?<a class=\"headerlink\" href=\"#how-does-the-contents-of-the-newspaper-corpus-change-over-time\" title=\"Permalink to this heading\">#</a></h1><p>This section will examine how the contents of the newspaper corpus changes over time and the implications of this for researchers. This includes topics like:</p>", "a[href=\"accessing-data/downloadable-datasets.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">14.3. </span>Downloadable datasets<a class=\"headerlink\" href=\"#downloadable-datasets\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"how-to/api/api.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21. </span>API<a class=\"headerlink\" href=\"#api\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"glossary.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Glossary<a class=\"headerlink\" href=\"#glossary\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"#welcome-to-the-trove-data-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Welcome to the Trove Data Guide<a class=\"headerlink\" href=\"#welcome-to-the-trove-data-guide\" title=\"Permalink to this heading\">#</a></h1><p>This guide will help you hone your data wrangling skills and develop a critical understanding of Trove as a source for digital research.</p>", "a[href=\"how-to/newspapers/get-ocr-coordinates.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">19.3. </span>HOW TO: Get information about the position of OCRd newspaper text<a class=\"headerlink\" href=\"#how-to-get-information-about-the-position-of-ocrd-newspaper-text\" title=\"Permalink to this heading\">#</a></h1><p>The OCR process not only extracts text from an image, it generates coordinates that document the position of each piece of text within the parent image. You could use this information to crop an image of the OCRd text out of the parent image. In the case of digitised newspapers, this sort of positional information could help you explore the layout and contents of newspaper pages and how this changes over time.</p><p>No positional information is available from the Trove API, however, there is some embedded within the web site. If you view the source of a newspaper article\u2019s web page, you\u2019ll find a number of <code class=\"docutils literal notranslate\"><span class=\"pre\">&lt;input&gt;</span></code> tags like this:</p>", "a[href=\"how-to/web-interface/web-interface.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">20. </span>Web interface<a class=\"headerlink\" href=\"#web-interface\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"how-to/web-interface/use-bulk-export.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">20.2. </span>Use the bulk export option to save the results of a search<a class=\"headerlink\" href=\"#use-the-bulk-export-option-to-save-the-results-of-a-search\" title=\"Permalink to this heading\">#</a></h1><p><mark>==Include more info once official documentation is available==</mark></p><p><mark>==Note that there are some differences in fields from the API==</mark></p>", "a[href=\"how-to/web-interface/download-higher-resolution-images.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">20.1. </span>How to download higher resolution versions of images from the web interface<a class=\"headerlink\" href=\"#how-to-download-higher-resolution-versions-of-images-from-the-web-interface\" title=\"Permalink to this heading\">#</a></h1><p>One confusing, and often frustrating, aspect of <a class=\"reference internal\" href=\"accessing-data/using-web-interface.html#downloading-images-web-interface\"><span class=\"std std-ref\">image downloads via the Trove web interface</span></a> is their resolution. You can use the Trove image viewer to zoom right in to many photographs and manuscripts, enabling you to pick up fine details. But if you download the same image you could find the resolution is much lower. This means you\u2019re limited in how you can use the downloaded image. The available resolutions vary across categories and formats, and you really don\u2019t know what you\u2019ll get until you download it. Many manuscripts, in particular, seem to have low-resolution downloads, which doesn\u2019t help you much when you\u2019re trying to decipher someone\u2019s handwriting!</p><p>Here\u2019s a couple of ways to get higher resolution versions.</p>", "a[href=\"how-to/newspapers/create-newspaper-articles-dataset.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">19.4. </span>How to create a dataset of digitised newspaper articles<a class=\"headerlink\" href=\"#how-to-create-a-dataset-of-digitised-newspaper-articles\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"genindex.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Index<a class=\"headerlink\" href=\"#index\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"pathways/pathways.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">18. </span>Research pathways<a class=\"headerlink\" href=\"#research-pathways\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"introduction/introduction.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Introduction<a class=\"headerlink\" href=\"#introduction\" title=\"Permalink to this heading\">#</a></h1><p>We all know how to use <a class=\"reference external\" href=\"https://trove.nla.gov.au/\">Trove</a>. You just type your search terms into the box and click the button. You then work your way through the first few pages of results, saving anything that looks useful. If, for example, I\u2019m interested in the development of radio in Australia, I could search for the term \u2018radio\u2019 in Trove\u2019s digitised newspapers. It\u2019s easy!</p>", "a[href=\"what-is-trove/works-and-versions.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">5. </span>Works and versions<a class=\"headerlink\" href=\"#works-and-versions\" title=\"Permalink to this heading\">#</a></h1><p>And editions and collections</p>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
